import axios from "axios";
import { disabled } from "express/lib/application";
import React from "react";
import useInput from "../hooks/formHook";

const NewUser = () => {
  const name = useInput();
  const userName = useInput();
  const email = useInput();
  const password=useInput();
  const confirmPassword=useInput();
  let checked=false

  const onChecked=(e)=>{
    checked=!checked
    return !e.target.checked
  }

  const submitHandler = (e) => {
    console.log("anda el submit");
    e.preventDefault();
    axios.post("api/users/newUser", {
      name: name.value,
      userName: userName.value,
      email: email.value,
    });
  };

  //   console.log({name: name.value,
  //     user: userName.value,
  //     email: email.value,})

  return (
    <div className="field user">
      <div>
        <label class="label">Name</label>
        <div class="control has-icons-left has-icons-right">
          <input {...name} class="input" type="text" placeholder="Your name" />
        </div>
      </div>

      <div class="field">
        <label class="label">Username</label>
        <div class="control has-icons-left has-icons-right">
          <input
            {...userName}
            className={`input`}
            type="text"
            placeholder="Your @username"
          />
          <span class="icon is-small is-left">
            <i class="fas fa-user"></i>
          </span>
          <span class="icon is-small is-right">
            <i class="fas fa-check"></i>
          </span>
        </div>
        {/* <p class="help is-success">This username is available</p> */}
      </div>

      <div class="field">
        <label class="label">Email</label>
        <div class="control has-icons-left has-icons-right">
          <input
            {...email}
            className={`input`}
            type="email"
            placeholder="Your mail@mail.com"
          />
          <span class="icon is-small is-left">
            <i class="fas fa-envelope"></i>
          </span>
          <span class="icon is-small is-right">
            <i class="fas fa-exclamation-triangle"></i>
          </span>
        </div>
        {/* <p class="help is-danger">This email is invalid</p> */}
      </div>
      <div class="field">
        <label class="label">Password</label>
        <p class="control has-icons-left">
          <input {...password} class="input" type="password" placeholder="Password" />
          <span class="icon is-small is-left">
            <i class="fas fa-lock"></i>
          </span>
        </p>
      </div>
      <div class="field">
        <label {...confirmPassword} class="label">Confirm Password</label>
        <p class="control has-icons-left">
          <input class="input" type="password" placeholder="Password" />
          <span class="icon is-small is-left">
            <i class="fas fa-lock"></i>
          </span>
        </p>
      </div>
      <div class="field">
        <div class="control">
          <label class="checkbox">
            <input onClick={onChecked} type="checkbox" />I agree to the{" "}
            <a href="#">terms and conditions</a>
          </label>
        </div>
      </div>

      <div class="field is-grouped">
        <div class="control">
          <button {...checked?(disable):null}disable onClick={submitHandler} type="submit" class="button is-link">
            Sign Up
          </button>
        </div>
        <div class="control">
          <button class="button is-link is-light">Cancel</button>
        </div>
      </div>
    </div>
  );
};

export default NewUser;
